def binary_search1(xs, x):

    lft, rgt = 0, len(xs)

    while lft < rgt:
        mid = (lft + rgt) // 2
        if xs[mid] == x:
            return mid
        if xs[mid] < x:
            lft = mid + 1
        else:
            rgt = mid

    return None

