def prime_check(n):


    assert type(n) is int, "Non int passed"
    assert n > 0, "No negative values allowed, or zero"

    if n == 1:
        return False
    i = 2

    while i*i < n + 1:
        if n != i and n % i == 0:
            return False
        i += 1

    return True

def format_bytes(size):

    size = float(size)
    KB = float(1024)
    MB = float(KB ** 2)  # 1,048,576
    GB = float(KB ** 3)  # 1,073,741,824

    if size < KB:
        return '{0} {1}'.format(size, 'B' if 0 == size > 1 else 'B')
    elif KB <= size < MB:
        return '{0:.2f} KiB'.format(size / KB)
    elif MB <= size < GB:
        return '{0:.2f} MiB'.format(size / MB)
    elif GB <= size:
        return '{0:.2f} GiB'.format(size / GB)

