    return blob

def pad(data, length):

    difference = length - len(data)
    if difference == 0:
        return data[:]
    if difference < 0:
        return data[:difference]
    return data + "\0"*difference

def to_unit_memory(number):

    kb = 1024

    number /= kb

    if number < 100:
        return '{} Kb'.format(round(number, 2))

    number /= kb
    if number < 300:
        return '{} Mb'.format(round(number, 2))

    number /= kb

    return '{} Gb'.format(round(number, 2))

