def _partition(srt, start, end):


    follower = leader = start
    while leader < end:
        if srt[leader] < srt[end]:
            srt[follower], srt[leader] = srt[leader], srt[follower]
            follower += 1
        leader += 1
    srt[follower], srt[end] = srt[end], srt[follower]
    return follower

