def number_to_human_size(size):

    if size == 1:
        return "1 Byte"
    elif size < 1024:
        return "%d Bytes" % size
    elif size < (1024**2):
        return "%.1f KB" % (size / 1024.00)
    elif size < (1024**3):
        return "%.1f MB" % (size / 1024.00**2)
    elif size < (1024**4):
        return "%.1f GB" % (size / 1024.00**3)
    elif size < (1024**5):
        return "%.1f TB" % (size / 1024.00**4)
    else:
        return ""

