def iterative(array, element, sort=False):

    if sort:
        array.sort()
    left = 0
    right = len(array) - 1
    while left <= right:
        mid = (right + left) // 2
        # indices of a list must be integer
        if array[mid] == element:
            return mid
        elif array[mid] > element:
            right = mid - 1
        else:
            left = mid + 1
    return None

