def peakedness(ze_bkg, peak_relation):

    if peak_relation == 0:
        if ze_bkg < 0.:
            peak = 10.
        elif (ze_bkg >= 0.) and (ze_bkg < 42.43):
            peak = 10. - ze_bkg ** 2 / 180.
        else:
            peak = 0.

    elif peak_relation == 1:
        if ze_bkg < 0.:
            peak = 14.
        elif (ze_bkg >= 0.) and (ze_bkg < 42.43):
            peak = 14. - ze_bkg ** 2 / 180.
        else:
            peak = 4.

