def primes(num):

    prime_list = [0]*num
    k = 0
    n = 2

    while k < num:
        iterator = 0
        while iterator < k and n % prime_list[iterator] != 0:
            iterator += 1

        if iterator == k:
            prime_list[k] = n
            k += 1

        n += 1

    return prime_list

